'use strict';

function get_data(target_id,url) {
    $.fn.dataTable.ext.errMode = 'none';
    var table = $(target_id).DataTable({
        "processing": true,
        "serverSide": true,
        "ajax": url,
        "columns": [
            {
                "className":      'details-control',
                "orderable": false,
                "render": function ( data, type, full, meta ) {
                    return '<button class="btn btn-sm btn-success btn-icon"><span class="fa fa-plus"></span></button>';
                }
            },
            { "data": "tournament.tournament_name" },
            { "data": "home.name" },
            { "data": "away.name" },
            {
                "render": function ( data, type, full, meta ) {
                    var date_info = moment(full.match_date).format('ddd, D MMMM YYYY [-] HH:mm [(GMT+7)]');
                    return date_info;
                }
            },
            { "data": "status" },
            {
                sortable: true,
                "render": function ( data, type, full, meta ) {
                    var html = '<button class="btn btn-sm btn-danger btn-icon remove m-l-5"><span class="fa fa-trash-o"></span></button>';

                    return  html;
                }
            }
        ]
    }).on('error.dt', function ( e, settings, techNote, message ) {
        console.log("Failed to get Match Data, please refresh page..");

    }).on('init.dt', function () {
        console.log('init '+n);
        table_loaded.push(n);
    });

    $(target+' tbody').on('click', 'td.details-control', function () {
        var tr = $(this).closest('tr');
        var row = table.row( tr );

        if ( row.child.isShown() ) {
            // This row is already open - close it
            row.child.hide();
            tr.removeClass('shown');
        }
        else {
            // Open this row
            row.child( format(row.data()) ).show();
            tr.addClass('shown');
        }
    } );

    $(target+' tbody').on( 'click', 'button.edit', function () {
        let row = table.row( $(this).parents('tr') ).data();
        let url = '{{Request::url()}}/edit/'+row['id'];
        window.location = url;
    } );


    $(target+' tbody').on( 'click', 'button.remove', function () {
        let row = table.row( $(this).parents('tr') ).data();
        let url = '{{Request::url()}}/delete/'+row['id'];
        let message = 'Delete match '+row['home']['name']+' vs '+row['away']['name']+'?';
        if(confirm(message)) {
            window.location = url;
        }
    } );
}

