function confirmClick(event) {
    if (!event.detail.confirmed) {
        event.preventDefault();
        event.stopImmediatePropagation();
        var message = this.getAttribute('confirm');
        message = message || "Are you sure?";
        if (confirm(message)) {
            console.log(event.type == 'submit');
            if (this.hasAttribute('href') && this.href[this.href.length - 1] != "#") {
                window.location = this.href;
            }
            else if (this.tagName == 'FORM') {
                this.submit();
            }
            else if (this.tagName == 'BUTTON' && this.type == 'submit') {
                this.form.submit();
            }
            else {
                this.dispatchEvent(new CustomEvent('click', {detail: {confirmed: true}}));
            }
        }
    }
}

function pop_delete(ele) {
    this.event.preventDefault();
    this.event.stopImmediatePropagation();

    var sweetdata = ele.dataset;

    if (!sweetdata.title) {
        sweetdata.title = "Delete this item?";
    }
    if (!sweetdata.description) {
        sweetdata.description = "Once deleted the item cannot be recovered."
    }
    if (!sweetdata.after) {
        sweetdata.after = "Item has been deleted!"
    }

    if ($.isFunction(swal)) {
        swal({
            title: sweetdata.title,
            text: sweetdata.description,
            icon: "warning",
            buttons: true,
            dangerMode: true,
        })
            .then(function (willDelete) {
                if (willDelete) {
                    swal(sweetdata.after, {
                        icon: "success",
                        timer: 1000
                    }).then(function (willContinue) {
                        if (sweetdata.href) {
                            swal.close();
                            setTimeout(function () {
                                window.location.href = sweetdata.href;
                            }, 500);
                        } else {
                            var count = 5;
                            setInterval(function () {
                                count--;
                                document.getElementById('pop_delete_timer').innerHTML = count;
                                if (count == 0) {
                                    swal.close();
                                }
                            }, 1000);
                        }
                    });
                }
            });
    } else {
        console.log('Please active Sweet Alert.');
    }
}

document.addEventListener('DOMContentLoaded', function () {
    var elements = document.querySelectorAll('[confirm]');
    for (var i = 0; i < elements.length; i++) {
        elements[i].addEventListener('click', confirmClick, false);
    }
});